class Solution {
    public boolean isAnagram(String s, String t) {
        Map<Character,Integer> map=new HashMap<>();
        char[] s1=s.toCharArray();
        for(char c: s1) {
            map.put(c, map.getOrDefault(c,0)+1);
        }

        Map<Character,Integer> map2=new HashMap<>();
        char[] t1=t.toCharArray();
        for(char c: t1) {
            map2.put(c, map2.getOrDefault(c,0)+1);
        }

        System.out.println("map:"+map);
        System.out.println("map2:"+map2);

        System.out.println("map keys:"+map.keySet().size());
        System.out.println("map2 keys:"+map2.keySet().size());

        if(map.keySet().size() != map2.keySet().size())
            return false;

        for(Map.Entry<Character,Integer> entry: map.entrySet()) {
            Character key=entry.getKey();
            Integer value=entry.getValue();

            if(!map2.containsKey(key) || !map2.get(key).equals(value))
                return false;
        }

        return true;


    }


    public List<Integer> findSubstring(String s, String[] words) {
        int n=s.length();
        int wordLen = words[0].length();
        int totalLen = wordLen * words.length;

        List<Integer> result=new ArrayList<>();

        Map<String,Integer> required=new HashMap<>();
        for(String word: words)
            required.put(word, required.getOrDefault(word,0)+1);

        for(int i=0;i<wordLen;i++) {
            int left=i, matched=0;
            Map<String, Integer> seen=new HashMap<>();

            for(int j=i;j<=(n - wordLen);j+= wordLen) {
                String w=s.substring(j, j+wordLen);
                if(required.containsKey(w)) {
                    seen.put(w, seen.getOrDefault(w, 0)+1);

                    if(seen.get(w) <= required.get(w))
                        matched++;

                    while(seen.get(w) > required.get(w)) {
                        String leftWord=s.substring(left, left+wordLen);
                        seen.put(leftWord, seen.get(leftWord)-1);
                        if(seen.get(leftWord) < required.get(leftWord)) {
                            matched--;
                        }
                        left+= wordLen;
                    }

                    if(matched == words.length) {
                        result.add(left);
                    }
                }
                else {
                    seen.clear();
                    matched=0;
                    left=j+wordLen;
                }
            }
        }

        return result;

    }
}
